import React,{Component} from 'react';
import {
  Switch,
  Route,
  Link
} from "react-router-dom";
import Login from './login';
import Register from './register';
import Accounts from './Accounts';
import Profile from './Profile';
import Nav from './Nav';
import Password from './Password';
import './App.css';
import 'tachyons';

class App extends Component {
  constructor(){
    super();
    this.state={
      user:{
    }}
  }
  render(){
      return (
      <div className="App">
        <header class="bg-black-90 fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l">
        <Nav link="signin" name="Sign In"/>
        <Nav link="signup" name="Sign Up"/>
        <Nav link="users" name="Active Users"/>
        <Nav link="profile" name="Profile"/>
        </header>
        <Switch>
          <Route path="/signin">
            <Login/>
          </Route>
          <Route path="/signup">
            <Register/>
          </Route>
          <Route path="/users">
            <Accounts/>
          </Route>
          <Route path="/profile">
            <Profile/>
            <br/>
            <Password/>
          </Route>
        </Switch>

      </div>
    );
    }
}

export default App;
